class Solution{
public:
    vector<int> findTwoElement(vector<int> arr, int n) {
        // code here
        int ans=-1,ans1=-1;
       
        
        int a[n+1]={0};
        for(int i=0;i<arr.size();i++)
        {
            a[arr[i]]+=1;
        }
        for(int i=1;i<=n;i++)
        {
            if(a[i]==0)
            {
                if(ans!=-1)
                {
                    continue;
                }
                ans=i;
            }
            if(a[i]==2)
            {
                if(ans1!=-1)
                {
                    continue;
                }
                ans1=i;
            }
            if(ans!=-1 && ans1!=-1)
            {
                break;
            }
        }
        return {ans1,ans};
    }
};

