using namespace std;

int gcd1(int a, int b) {
    if (b == 0)
        return a;
    return gcd1(b, a % b);
}

int gcd2(int a, int b) {
    while (b > 0) {
        a %= b;
        swap(a, b);
    }
    return a;
}

int lcm(int a, int b) {
    return a * b / gcd1(a, b);
}

