bool floyd(int n) {
    for (int k = 0; k < n; k++) {
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (k != i and k != j) {
                    if (graf[i][j] == graf[i][k] + graf[k][j]) {
                        st.insert(make_pair(i, j));
                        st.insert(make_pair(j, i));
                    }
                    else if (graf[i][j] > graf[i][k] + graf[k][j]) {
                        //graf[i][j] = graf[i][k] + graf[k][j];
                        return false;
                    }
                }
            }
        }
    }
    return true;
}

