#include <algorithm>
#include <iostream>
#include <vector>

using namespace std;

vector<vector<int>> G; // G -  
vector<int> d; // d[i] = x,  ,        i-  x
               // d[i] = -1, ,      i- 
vector<int> p; // p[i] = x, ,           i- -  x->i

void dfs(int v) { // dfs(v)    ,   v.  dfs             
    for (int nxt : G[v]) { //  ,   v-
        if (d[nxt] == -1) {  //  nxt-    ,    
            d[nxt] = d[v] + 1; //    nxt-  -     v + 1 (1 -    v->nxt)
            p[nxt] = v; //    nxt   v->nxt
            dfs(nxt); //  dfs  nxt- 
        }
    }
}

void solve() {
    int n;
    cin >> n; //  -   
    G.resize(n);
    d.resize(n, -1); //     -1, d[v] = -1  ,     
    p.resize(n);
    for (int i = 1; i < n; ++i) { //    
        int x;
        cin >> x; //   i- 
        x--; //  x  1,        1,     ,      0
        //    ,      i->x,    x->i
        G[i].push_back(x);
        G[x].push_back(i);
    }
    //     ,      
    d[0] = 0; //   0-      0
    dfs(0); //  dfs  0- 
    int start_d = 0; // start_d -     .
                     //    ,    0-       .
                     //     -  start_d,  -  0
    for (int i = 0; i < n; ++i) { //  
        if (d[i] > d[start_d]) { //    0-  i- ,   start_d-,     start_d
            start_d = i;
        }
    }
    //     
    for (int i = 0; i < n; ++i) {
        d[i] = -1;
    }
    d[start_d] = 0; //   start_d-      0
    dfs(start_d); //  dfs  start_d- 
    int end_d = 0; // end_d -   .
                   //    ,    start_d-       .
                   //     -  end_d,  -  0
    for (int i = 0; i < n; ++i) { //  
        if (d[i] > d[end_d]) { //    start_d-   i- ,   end_d,     end_d
            end_d = i;
        }
    }
    vector<int> path; // path -  ,   .     path ,     ,  path[0]  path.back() -   
    int at = end_d; // at -    .    end_d
    while (at != start_d) { //      start_d  
        path.push_back(at); //     
        at = p[at]; //      
    }
    path.push_back(at); //   ,    start_d (at == start_d)
    vector<int> ans; // ans -    
    if (path.size() % 2 == 0) { //      - ,    2 ,    
        ans.push_back(path[path.size() / 2 - 1]);
        ans.push_back(path[path.size() / 2]);
    } else { //      - ,    ,    
        ans.push_back(path[path.size() / 2]);
    }
    sort(ans.begin(), ans.end()); //   ,        
    for (auto el : ans) {
        cout << el + 1 << ' '; //        0,     1,         1
    }
}

